import React from 'react';
import { Box } from '@mui/system';
import '../styles/Article.css';
import { Card, List } from '@mui/material';
import ListItem from '@mui/material/ListItem';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import InboxIcon from '@mui/icons-material/Inbox';
import Typography from '@mui/material/Typography';

import Chip from '@mui/material/Chip';

const Article = () => {
  return (
    <Card elevation={10} sx={{ display: 'flex', allignItems: 'centre' }}>
      <img
        src="https://c1.wallpaperflare.com/preview/395/809/250/glass-jar-flower-vase.jpg"
        alt="vase in a room minimalist"
        className="articleImg"
      />
      <Box>
        <Chip label="Travel" />
        <Typography variant="h4" component="h3">
          I Created A Developer Rap Video - Here's What I Learned From It. Check
          It Out.
        </Typography>
        <Box className="listItems">
          <List>
            <ListItem className="user" disablePadding>
              <ListItemIcon>
                <InboxIcon />
              </ListItemIcon>
              <ListItemText primary="Inbox" />
            </ListItem>
            <ListItem className="date" disablePadding>
              <ListItemIcon>
                <InboxIcon />
              </ListItemIcon>
              <ListItemText primary="Inbox" />
            </ListItem>
            <ListItem className="timeToRead" disablePadding>
              <ListItemIcon>
                <InboxIcon />
              </ListItemIcon>
              <ListItemText primary="Inbox" />
            </ListItem>
          </List>
        </Box>
      </Box>
    </Card>
  );
};

export default Article;
